import React from 'react'
import { NavLink } from 'react-router-dom';
import homeIcon from '../homeIcon.png'

const SignUp = () => {
    return (
        <div className="app" >

            <p>Here you should sign up</p>
            <NavLink to="/" >
                <img className="homebutton" src={homeIcon} alt="homeIcon" />
            </NavLink>
        </div>
    )
}

export default SignUp;
